    const estadoConfig = estadosMap[act.EstadoDb];
    if (!estadoConfig) return acc;

    if (!acc[act.EstadoDb]) {
      acc[act.EstadoDb] = { ...estadoConfig, actividades: [] };
    }

    acc[act.EstadoDb].actividades.push(act);

    return acc;
  }, {}),
